import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import { Link } from 'react-router-dom';
import { MDBInput } from "mdbreact";
import { MDBCol, MDBIcon, MDBRow } from "mdbreact";
import { Grid, Row, Col } from 'react-bootstrap';



class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (

        <MDBRow>
                <MDBCol size="2">
                <img src={require('./images/logo.png')} style={{ width: '120px', height: '120px' }} />               
                </MDBCol>
                <MDBCol size="2">
                        <Nav className="mr-auto">
                              <Nav.Link style={{border: '1px solid'}}><Link to='/'>Home</Link></Nav.Link>
                              <Nav.Link><Link to='/products'>Products</Link></Nav.Link>
                              <Nav.Link><Link to='/events'>Events</Link></Nav.Link>
                              <Nav.Link><Link to='/jewelry-care'>Jewelry Care</Link></Nav.Link>
                              <Nav.Link><Link to='/contact'>Contact US</Link></Nav.Link>
                       </Nav>    
                </MDBCol>

                <MDBCol md="2">
                       <MDBInput hint="Search" type="text" containerClass="mt-0" />
                </MDBCol>

                <MDBCol size="3">
                     <Nav.Link><Link to='/products'><i class="fab fa-facebook-f"></i></Link></Nav.Link>
                     <Nav.Link><Link to='/products'><i class="fab fa-twitter"></i></Link></Nav.Link>
                     <Nav.Link><Link to='/products'><i class="fab fa-instagram"></i></Link></Nav.Link>           

                </MDBCol>
      </MDBRow>









    );
  }
}


export default Header;
